import React, { useState, useEffect, useRef } from 'react';
import { FiDatabase, FiLayout, FiServer, FiTool } from 'react-icons/fi';

export default function Skills() {
  const [visible, setVisible] = useState(new Set());
  const ref = useRef(null);

  const categories = [
    {title:'Frontend',icon:FiLayout,skills:[{name:'React',level:90},{name:'JS',level:95},{name:'HTML/CSS',level:95},{name:'Tailwind',level:90}]},
    {title:'Backend',icon:FiServer,skills:[{name:'Node.js',level:88},{name:'Python',level:82},{name:'Express',level:85}]},
    {title:'Database',icon:FiDatabase,skills:[{name:'MongoDB',level:85},{name:'PostgreSQL',level:80}]},
    {title:'Tools',icon:FiTool,skills:[{name:'Git',level:95},{name:'Docker',level:75}]},
  ];

  useEffect(()=>{
    const obs = new IntersectionObserver(entries=>{
      entries.forEach(e=>{
        if(e.isIntersecting) setVisible(s=>new Set([...s,e.target.dataset.id]));
      });
    },{threshold:0.5});
    ref.current.querySelectorAll('[data-id]').forEach(el=>obs.observe(el));
  },[]);

  return (
    <section id="skills" className="section-padding" ref={ref}>
      <div className="container-custom">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold mb-6 animate-fadeInUp">My Skills</h2>
          <p className="text-lg text-gray-600 dark:text-gray-300 max-w-3xl mx-auto animate-fadeInUp">
            Technologies and tools I work with, animated on scroll.
          </p>
        </div>
        <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-6 mb-16">
          {categories.map((c,i)=>(
            <div key={i} className="card p-6 text-center animate-fadeInUp" style={{animationDelay:`${i*0.1}s`}}>
              <div className="w-16 h-16 mx-auto mb-4 bg-primary-100 dark:bg-primary-900/30 rounded-full flex items-center justify-center">
                <c.icon className="w-8 h-8 text-primary-600 dark:text-primary-400"/>
              </div>
              <h3 className="text-xl font-semibold mb-2">{c.title}</h3>
              <p className="text-gray-600 dark:text-gray-300">{c.skills.length} Technologies</p>
            </div>
          ))}
        </div>
        <div className="grid lg:grid-cols-2 gap-12">
          {categories.map((c,ci)=>(
            <div key={ci} className="card p-8 animate-fadeInUp" style={{animationDelay:`${ci*0.2}s`}}>
              <div className="flex items-center mb-6">
                <div className="w-12 h-12 bg-primary-100 dark:bg-primary-900/30 rounded-lg flex items-center justify-center mr-4">
                  <c.icon className="w-6 h-6 text-primary-600 dark:text-primary-400"/>
                </div>
                <h3 className="text-2xl font-bold">{c.title}</h3>
              </div>
              <div className="space-y-4">
                {c.skills.map((s,si)=>(
                  <div key={si}>
                    <div className="flex justify-between mb-2">
                      <span>{s.name}</span>
                      <span>{s.level}%</span>
                    </div>
                    <div className="skill-bar bg-gray-200 dark:bg-gray-700 h-2 rounded" data-id={`${c.title}-${s.name}`}>
                      <div className={`skill-progress bg-gradient-to-r from-primary-500 to-purple-600 h-full rounded transition-all`} style={{width: visible.has(`${c.title}-${s.name}`)?`${s.level}%`:'0%'}}/>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
